import { Announcement } from "@material-ui/icons";
import styled from "styled-components";
import Navbar from "./../components/Navbar";
import Footer from "./../components/Footer";

const Container = styled.div``;

const Cart = () => {
  return (
    <Container>
      <Navbar />
      <Announcement />
      cart
      <Footer />
    </Container>
  );
};

export default Cart;
